import React from 'react'
import { Col } from 'reactstrap';



const DefaultLayout = (photo, label, value) => {
    return (
        <React.Fragment>
            <Col xs="0.5" >
                <img src={photo} alt={value} width="35px" height="35px" />
            </Col>
            <Col lg="5" xs="3" sm="8"  >
                <div style={{ fontSize: "0.9rem" }}>{label}</div>
            </Col>
        </React.Fragment>
    )
}

export default DefaultLayout
